import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

function JobResults() {
  const location = useLocation();
  const navigate = useNavigate();
  const jobData = location.state;

  if (!jobData) {
    return (
      <div>
        <h2>No job preferences provided!</h2>
        <button onClick={() => navigate("/parttimejob")}>Go Back</button>
      </div>
    );
  }

  return (
    <div className="results-container">
      <h2>Job Preferences Summary</h2>
      <ul>
        <li><strong>Qualification:</strong> {jobData.qualification}</li>
        <li><strong>Indian:</strong> {jobData.isIndian}</li>
        {jobData.isIndian === "no" && (
          <li><strong>Country:</strong> {jobData.country}</li>
        )}
        <li><strong>Student:</strong> {jobData.isStudent}</li>
        {jobData.isStudent === "yes" && (
          <>
            <li><strong>College:</strong> {jobData.college}</li>
            <li><strong>College ID Uploaded:</strong> {jobData.collegeId ? "Yes" : "No"}</li>
          </>
        )}
        <li><strong>Age:</strong> {jobData.age}</li>
        <li><strong>Night Shift:</strong> {jobData.nightShift}</li>
        <li><strong>Location:</strong> {jobData.location}</li>
        <li><strong>Role:</strong> {jobData.role}</li>
        <li><strong>Timing:</strong> {jobData.timing}</li>
        <li><strong>Expected Salary:</strong> {jobData.salary}</li>
      </ul>
      <button onClick={() => navigate("/parttimejob")}>Back</button>
    </div>
  );
}

export default JobResults;
